// pages/HomePage.tsx
import React from 'react';
import './HomePage.css'; // Импортируем файл стилей

const HomePage: React.FC = () => {
  // Здесь вы можете использовать useEffect для получения данных о студентах и отображения их в таблице
  return (
    <div className="home-page">
      <h1 className="home-page__title">Добро пожаловать на главную страницу</h1>
      <p className="home-page__info">
        На главной странице неавторизованный пользователь имеет возможность только просмотреть и отсортировать студентов, 
        которые в данный момент проживают в общежитии, для манипуляций с информацией необходимо авторизоваться.
      </p>
      {/* Здесь будет ваша таблица со студентами */}
    </div>
  );
};

export default HomePage;
